(337, 'elementor_remote_info_feed_data', 'a:3:{i:0;a:5:{s:5:\"title\";s:35:\"Introducing Elementor Developer API\";s:7:\"excerpt\";s:197:\"Take a look at the new resource center for Elementor developers, which comes included with complete code reference, as well as tutorials explaining how to develop your own extensions for Elementor.\";s:7:\"created\";s:10:\"1523442624\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:130:\"https://elementor.com/introducing-elementor-developer-api/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:54:\"Introducing Blocks - The Fastest Way to Build Websites\";s:7:\"excerpt\";s:100:\"Were proud to announce the launch of Elementor Blocks, the new crazy-fast way to create websites!\";s:7:\"created\";s:10:\"1522053607\";s:5:\"badge\";s:3:\"New\";s:3:\"url\";s:113:\"https://elementor.com/introducing-blocks/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:70:\"Elementor 2.0  Were Reinventing WordPress Design, All Over Again\";s:7:\"excerpt\";s:222:\"Something new is about to arrive. In the coming weeks, we will gradually introduce Elementor version 2.0. Each release will focus on solving a substantial WordPress pain felt by users, yet never been dealt with before. \";s:7:\"created\";s:10:\"1519735624\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:116:\"https://elementor.com/upcoming-elementor-v2/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
