sta, inquam, Piso, magna dissensio. Sed fortuna fortis;,<\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"aaa0b6c\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"7a1621c\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"6b12d33\",\"elType\":\"widget\",\"settings\":{\"button_type\":\"success\",\"text\":\"Click me\",\"size\":\"lg\"},\"elements\":[],\"widgetType\":\"button\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"6d45390\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"1f14eb7\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"dd755ed\",\"elType\":\"widget\",\"settings\":{\"html\":\"<div class=\\\"container \\\">\\n    <h1 class=\\\"text-success\\\">this is a test with html code with bootstrap library\\n    <\\/h1>\\n    <h1>Example heading with bootstrap library <span class=\\\"badge badge-secondary\\\">New<\\/span>\\n    <\\/h1>\\n    \\n<button type=\\\"button\\\" class=\\\"btn btn-primary\\\">Primary<\\/button>\\n<button type=\\\"button\\\" class=\\\"btn btn-secondary\\\">Secondary<\\/button>\\n<button type=\\\"button\\\" class=\\\"btn btn-success\\\">Success<\\/button>\\n<button type=\\\"button\\\" class=\\\"btn btn-danger\\\">Danger<\\/button>\\n<button type=\\\"button\\\" class=\\\"btn btn-warning\\\">Warning<\\/button>\\n<button type=\\\"button\\\" class=\\\"btn btn-info\\\">Info<\\/button>\\n<button type=\\\"button\\\" class=\\\"btn btn-light\\\">Light<\\/button>\\n<button type=\\\"button\\\" class=\\\"btn btn-dark\\\">Dark<\\/button>\\n\\n<button type=\\\"button\\\" class=\\\"btn btn-link\\\">Link<\\/button>\\n<\\/div>\"},\"elements\":[],\"widgetType\":\"html\"}],\"isInner\":false}],\"isInner\":false}]'),
