(7469, 880, 'text', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Duo Reges: constructio interrete. Si sapiens, ne tum quidem miser, cum ab Oroete, praetore Darei, in crucem actus est. Huius, Lyco, oratione locuples, rebus ipsis ielunior. Ex quo intellegitur idem illud, solum bonum esse, quod honestum sit, idque esse beate vivere: honeste, id est cum virtute, vivere. Bonum patria: miserum exilium. Potius ergo illa dicantur: turpe esse, viri non esse debilitari dolore, frangi, succumbere. Amicitiae vero locus ubi esse potest aut quis amicus esse cuiquam, quem non ipsum amet propter ipsum? Nondum autem explanatum satis, erat, quid maxime natura vellet. Similiter sensus, cum accessit ad naturam, tuetur illam quidem, sed etiam se tuetur;'),
