(404, 1, '2018-01-26 20:25:06', '2018-01-26 20:25:06', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quid iudicant sensus? Estne, quaeso, inquam, sitienti in bibendo voluptas? Disserendi artem nullam habuit. Duo Reges: constructio interrete. Quarum ambarum rerum cum medicinam pollicetur, luxuriae licentiam pollicetur. Ille enim occurrentia nescio quae comminiscebatur; Tubulo putas dicere? Stoici scilicet.\r\n\r\nNam quid possumus facere melius? Sed quae tandem ista ratio est?\r\n\r\nQuid, quod res alia tota est? Explanetur igitur. Cum id fugiunt, re eadem defendunt, quae Peripatetici, verba. Maximus dolor, inquit, brevis est. Ut aliquid scire se gaudeant? Qui est in parvis malis. Tu vero, inquam, ducas licet, si sequetur;\r\n\r\nNon laboro, inquit, de nomine. Tubulo putas dicere? Quid ergo hoc loco intellegit honestum? Paria sunt igitur.\r\n\r\nDic in quovis conventu te omnia facere, ne doleas. Itaque ab his ordiamur. Idemne, quod iucunde? De hominibus dici non necesse est. An potest, inquit ille, quicquam esse suavius quam nihil dolere? Universa enim illorum ratione cum tota vestra confligendum puto.', 'News Post 2', '', 'publish', 'open', 'open', '', 'tut-post', '', '', '2018-02-03 00:49:26', '2018-02-03 00:49:26', '', 0, 'http://localhost/wpzaman/?p=404', 0, 'post', '', 0),
