(582, 1, '2018-02-03 00:48:51', '2018-02-03 00:48:51', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quid iudicant sensus? Estne, quaeso, inquam, sitienti in bibendo voluptas? Disserendi artem nullam habuit. Duo Reges: constructio interrete. Quarum ambarum rerum cum medicinam pollicetur, luxuriae licentiam pollicetur. Ille enim occurrentia nescio quae comminiscebatur; Tubulo putas dicere? Stoici scilicet.\r\n\r\nNam quid possumus facere melius? Sed quae tandem ista ratio est?\r\n\r\nQuid, quod res alia tota est? Explanetur igitur. Cum id fugiunt, re eadem defendunt, quae Peripatetici, verba. Maximus dolor, inquit, brevis est. Ut aliquid scire se gaudeant? Qui est in parvis malis. Tu vero, inquam, ducas licet, si sequetur;\r\n\r\nNon laboro, inquit, de nomine. Tubulo putas dicere? Quid ergo hoc loco intellegit honestum? Paria sunt igitur.\r\n\r\nDic in quovis conventu te omnia facere, ne doleas. Itaque ab his ordiamur. Idemne, quod iucunde? De hominibus dici non necesse est. An potest, inquit ille, quicquam esse suavius quam nihil dolere? Universa enim illorum ratione cum tota vestra confligendum puto.', 'News Post 1', '', 'inherit', 'closed', 'closed', '', '406-revision-v1', '', '', '2018-02-03 00:48:51', '2018-02-03 00:48:51', '', 406, 'http://localhost/wpzaman/2018/02/03/406-revision-v1/', 0, 'revision', '', 0),
