(625, 1, '2018-02-05 19:38:42', '2018-02-05 19:38:42', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quod iam a me expectare noli. Praeclare enim Plato: Beatum, cui etiam in senectute contigerit, ut sapientiam verasque opiniones assequi possit. Duo Reges: constructio interrete. Collige omnia, quae soletis: Praesidium amicorum. Non dolere, inquam, istud quam vim habeat postea videro; Qui enim voluptatem ipsam contemnunt, iis licet dicere se acupenserem maenae non anteponere. Non minor, inquit, voluptas percipitur ex vilissimis rebus quam ex pretiosissimis. In contemplatione et cognitione posita rerum, quae quia deorum erat vitae simillima, sapiente visa est dignissima. Nos quidem Virtutes sic natae sumus, ut tibi serviremus, aliud negotii nihil habemus. Cupiditates non Epicuri divisione finiebat, sed sua satietate. Et nunc quidem quod eam tuetur, ut de vite potissimum loquar, est id extrinsecus; Quae enim adhuc protulisti, popularia sunt, ego autem a te elegantiora desidero.', 'News Post 6 Lorem ipsum dolor sit amet, consectetur adipiscing elit.', '', 'publish', 'closed', 'closed', '', 'news-post-6', '', '', '2018-02-05 20:15:47', '2018-02-05 20:15:47', '', 0, 'http://localhost/wpzaman/?post_type=news&#038;p=625', 0, 'news', '', 0),
(626, 1, '2018-02-05 19:39:32', '2018-02-05 19:39:32', 'Quicquid enim a sapientia proficiscitur, id continuo debet expletum esse omnibus suis partibus; Octavio fuit, cum illam severitatem in eo filio adhibuit, quem in adoptionem D. Ad quorum et cognitionem et usum iam corroborati natura ipsa praeeunte deducimur. Neque enim disputari sine reprehensione nec cum iracundia aut pertinacia recte disputari potest. Duo Reges: constructio interrete. Omnes enim iucundum motum, quo sensus hilaretur. Nam prius a se poterit quisque discedere quam appetitum earum rerum, quae sibi conducant, amittere. Effluit igitur voluptas corporis et prima quaeque avolat saepiusque relinquit causam paenitendi quam recordandi. Aufidio, praetorio, erudito homine, oculis capto, saepe audiebam, cum se lucis magis quam utilitatis desiderio moveri diceret. Introduci enim virtus nullo modo potest, nisi omnia, quae leget quaeque reiciet, unam referentur ad summam. Quis non odit sordidos, vanos, leves, futtiles? Non est ista, inquam, Piso, magna dissensio. Sed fortuna fortis;', 'News Post 7 Lorem ipsum dolor sit amet, consectetur adipiscing elit.', '', 'publish', 'closed', 'closed', '', 'news-post-7', '', '', '2018-02-05 20:15:28', '2018-02-05 20:15:28', '', 0, 'http://localhost/wpzaman/?post_type=news&#038;p=626', 0, 'news', '', 0),
