(638, 1, '2018-02-08 03:04:56', '2018-02-08 03:04:56', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Piso, familiaris noster, et alia multa et hoc loco Stoicos irridebat: Quid enim? Quis enim potest istis, quae te, ut ais, delectant, brevibus et acutis auditis de sententia decedere? In eo autem voluptas omnium Latine loquentium more ponitur, cum percipitur ea, quae sensum aliquem moveat, iucunditas. Duo Reges: constructio interrete. Ut, inquit, in fidibus pluribus, nisi nulla earum non ita contenta nervis sit, ut concentum servare possit, omnes aeque incontentae sint, sic peccata, quia discrepant, aeque discrepant; Nam haec ipsa mihi erunt in promptu, quae modo audivi, nec ante aggrediar, quam te ab istis, quos dicis, instructum videro. A villa enim, credo, et: Si ibi te esse scissem, ad te ipse venissem. Quodsi esset in voluptate summum bonum, ut dicitis, optabile esset maxima in voluptate nullo intervallo interiecto dies noctesque versari, cum omnes sensus dulcedine omni quasi perfusi moverentur. Eademne, quae restincta siti? Itaque non discedit ab eorum curatione, quibus praeposita vitam omnem debet gubernare, ut mirari satis istorum inconstantiam non possim.\r\n\r\nNihil enim possumus iudicare, nisi quod est nostri iudicii-in quo frustra iudices solent, cum sententiam pronuntiant, addere: si quid mei iudicii est; Itaque et vivere vitem et mori dicimus arboremque et novellan et vetulam et vigere et senescere. Quodsi Graeci leguntur a Graecis isdem de rebus alia ratione compositis, quid est, cur nostri a nostris non legantur? Quanta autem ab illis varietas argumentorum ratione concludentium eorumque cum captiosis interrogationibus dissimilitudo! Quid, quod plurimis locis quasi denuntiant, ut neque sensuum fidem sine ratione nec rationis sensibus exquiramus? Voluptatem cum summum bonum diceret, primum in eo ipso parum vidit, deinde hoc quoque alienum; Cognitio autem haec est una nostri, ut vim corporis animique norimus sequamurque eam vitam, quae rebus iis ipsis perfruatur. Nam omnia, quae sumenda quaeque legenda aut optanda sunt, inesse debent in summa bonorum, ut is, qui eam adeptus sit, nihil praeterea desideret. Quos quidem dies quem ad modum agatis et in quantam hominum facetorum urbanitatem incurratis, non diconihil opus est litibus-; Si ad prudentes, alterum fortasse dubitabunt, sitne tantum in virtute, ut ea praediti vel in Phalaridis tauro beati sint, alterum non dubitabunt, quin et Stoici conveniente sibi dicant et vos repugnantia. Graece ergo praetor Athenis, id quod maluisti, te, cum ad me accedis, saluto: chaere, inquam, Tite! lictores, turma omnis chorusque: chaere, Tite! hinc hostis mi Albucius, hinc inimicus. Qualis ista philosophia est, quae non interitum afferat pravitatis, sed sit contenta mediocritate vitiorum? Omne enim animal, simul et ortum est, se ipsum et omnes partes suas diligit duasque, quae maximae sunt, in primis amplectitur, animum et corpus, deinde utriusque partes.\r\n\r\nQuid, cum fictas fabulas, e quibus utilitas nulla elici potest, cum voluptate legimus? Hic cum uterque me intueretur seseque ad audiendum significarent paratos, Primum, inquam, deprecor, ne me tamquam philosophum putetis scholam vobis aliquam explicaturum, quod ne in ipsis quidem philosophis magnopere umquam probavi. Nec enim, omnes avaritias si aeque avaritias esse dixerimus, sequetur ut etiam aequas esse dicamus.\r\n\r\nSit, inquam, tam facilis, quam vultis, comparatio voluptatis, quid de dolore dicemus? Sit hoc ultimum bonorum, quod nunc a me defenditur; Quid loquor de nobis, qui ad laudem et ad decus nati, suscepti, instituti sumus? Age, inquies, ista parva sunt. Sed si duo honesta proposita sint, alterum cum valitudine, alterum cum morbo, non esse dubium, ad utrum eorum natura nos ipsa deductura sit. Quem enim deditum voluptatibus, quem cupiditatum incendiis inflammatum in iis potiendis, quae acerrime concupivisset, tanta laetitia perfundi arbitramur, quanta aut superiorem Africanum Hannibale victo aut posteriorem Karthagine eversa? Ut iam liceat una comprehensione omnia complecti non dubitantemque dicere omnem naturam esse servatricem sui idque habere propositum quasi finem et extremum, se ut custodiat quam in optimo sui generis statu; Laboribus hic praeteritis gaudet, tu iubes voluptatibus, et hic se ad ea revocat, e quibus nihil umquam rettulerit ad corpus, tu totus haeres in corpore. Illud quaero, quid ei, qui in voluptate summum bonum ponat, consentaneum sit dicere. Quod si ita est, sequitur id ipsum, quod te velle video, omnes semper beatos esse sapientes.\r\n\r\nNam et amici cultus et parentis ei, qui officio fungitur, in eo ipso prodest, quod ita fungi officio in recte factis est, quae sunt orta virtutibus. Si scieris, inquit Carneades, aspidem occulte latere uspiam, et velle aliquem inprudentem super eam assidere, cuius mors tibi emolumentum futura sit, improbe feceris, nisi monueris ne assidat, sed inpunite tamen; Quod mihi quidem visus est, cum sciret, velle tamen confitentem audire Torquatum. Mihi quidem eae verae videntur opiniones, quae honestae, quae laudabiles, quae gloriosae, quae in senatu, quae apud populum, quae in omni coetu concilioque profitendae sint, ne id non pudeat sentire, quod pudeat dicere. Quod quoniam in quo sit magna dissensio est, Carneadea nobis adhibenda divisio est, qua noster Antiochus libenter uti solet. Quid, si non modo utilitatem tibi nullam afferet, sed iacturae rei familiaris erunt faciendae, labores suscipiendi, adeundum vitae periculum? Principiis autem a natura datis amplitudines quaedam bonorum excitabantur partim profectae a contemplatione rerum occultiorum, quod erat insitus menti cognitionis amor, e quo etiam rationis explicandae disserendique cupiditas consequebatur; Quae cum dixissem, magis ut illum provocarem quam ut ipse loquerer, tum Triarius leniter arridens: Tu quidem, inquit, totum Epicurum paene e philosophorum choro sustulisti. Sin ea non neglegemus neque tamen ad finem summi boni referemus, non multum ab Erilli levitate aberrabimus. Tenuit permagnam Sextilius hereditatem, unde, si secutus esset eorum sententiam, qui honesta et recta emolumentis omnibus et commodis anteponerent, nummum nullum attigisset. Neque enim in aliqua parte, sed in perpetuitate temporis vita beata dici solet, nec appellatur omnino vita, nisi confecta atque absoluta, nec potest quisquam alias beatus esse, alias miser; Sed isti ipsi, qui voluptate et dolore omnia metiuntur, nonne clamant sapienti plus semper adesse quod velit quam quod nolit? Ut in geometria, prima si dederis, danda sunt omnia. Multi enim et magni philosophi haec ultima bonorum iuncta fecerunt, ut Aristoteles virtutis usum cum vitae perfectae prosperitate coniunxit, Callipho adiunxit ad honestatem voluptatem, Diodorus ad eandem honestatem addidit vacuitatem doloris. At vero facere omnia, ut adipiscamur, quae secundum naturam sint, etiam si ea non assequamur, id esse et honestum et solum per se expetendum et solum bonum Stoici dicunt.', 'Event 1 Shoulder kevin strip steak buffalo', '', 'publish', 'closed', 'closed', '', 'event-1-shoulder-kevin-strip-steak-buffalo', '', '', '2018-02-08 06:14:27', '2018-02-08 06:14:27', '', 0, 'http://localhost/wpzaman/?post_type=event&#038;p=638', 0, 'event', '', 0),
