(793, 1, '2018-03-18 18:39:12', '2018-03-18 22:39:12', 'Quicquid enim a sapientia proficiscitur, id continuo debet expletum esse omnibus suis partibus; Octavio fuit, cum illam severitatem in eo filio adhibuit, quem in adoptionem D. Ad quorum et cognitionem et usum iam corroborati natura ipsa praeeunte deducimur. Neque enim disputari sine reprehensione nec cum iracundia aut pertinacia recte disputari potest. Duo Reges: constructio interrete. Omnes enim iucundum motum, quo sensus hilaretur. Nam prius a se poterit quisque discedere quam appetitum earum rerum, quae sibi conducant, amittere. Effluit igitur voluptas corporis et prima quaeque avolat saepiusque relinquit causam paenitendi quam recordandi. Aufidio, praetorio, erudito homine, oculis capto, saepe audiebam, cum se lucis magis quam utilitatis desiderio moveri diceret. Introduci enim virtus nullo modo potest, nisi omnia, quae leget quaeque reiciet, unam referentur ad summam. Quis non odit sordidos, vanos, leves, futtiles? Non est ista, inquam, Piso, magna dissensio. Sed fortuna fortis;', 'News Post 9 Lorem ipsum dolor sit amet, consectetur adipiscing elit.', '', 'inherit', 'closed', 'closed', '', '628-revision-v1', '', '', '2018-03-18 18:39:12', '2018-03-18 22:39:12', '', 628, 'http://localhost/wpzaman/628-revision-v1/', 0, 'revision', '', 0),
